import {useSelector} from 'react-redux'
import {useEffect} from 'react'

const Subscribe = (props) => {

    const id = props.id
    const movies = useSelector(state => state.movies)

    return (
        <>
            <p>Add a new movie</p>
            <form>
                <button>Subscribe</button>
            </form>
        </>
    )
}

export default Subscribe
